import React from "react";
import {Header} from './Header'
import './conocerEquipo.css';

function conocerEquipo(){
    return(
        <div className="interfaz-equipo">
            <Header/>
            <div className="bloque-contenido">
                <h1>HOLA</h1>
            </div>
        </div>
    )
}

export default conocerEquipo
